import React, { useState, useEffect } from 'react';
import jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';
import { Document, Packer, Paragraph, Table, TableCell, TableRow, TextRun } from 'docx';
import { saveAs } from 'file-saver';

function ResultsTable({ projectData, updateEstimates }) {
    // Use a default empty structure to avoid undefined errors
    const [estimates, setEstimates] = useState(projectData?.estimates?.tasks || []);

    // Ensure estimates are updated when projectData changes
    useEffect(() => {
        if (projectData && projectData.estimates) {
            setEstimates(projectData.estimates.tasks);
        }
    }, [projectData]);

    // Handle inline editing
    const handleEdit = (taskIndex, subtaskIndex, field, value) => {
        const updatedEstimates = [...estimates];
        updatedEstimates[taskIndex].subtasks[subtaskIndex][field] = value;
        setEstimates(updatedEstimates);
    };

    // Save changes
    const handleSave = () => {
        updateEstimates(estimates); // Pass updated estimates to parent
        alert('Changes saved successfully!');
    };

    // Export to PDF
    const exportToPDF = () => {
        const doc = new jsPDF();
        doc.text('Project Task Details', 10, 10);
        autoTable(doc, {
            head: [['Task', 'Subtask', 'Development Hours', 'Comments/Notes']],
            body: estimates.flatMap((task) => 
                task.subtasks.map(({ subtask, hours, comments }) => [
                    task.task,
                    subtask,
                    `${hours} hours`,
                    comments || 'N/A',
                ])
            ),
        });
        doc.save('Project_Estimates.pdf');
    };

    // Export to DOCX
    const exportToDOCX = () => {
        const rows = estimates.flatMap((task) =>
            task.subtasks.map(({ subtask, hours, comments }) => {
                return new TableRow({
                    children: [
                        new TableCell({ children: [new Paragraph(task.task)] }),
                        new TableCell({ children: [new Paragraph(subtask)] }),
                        new TableCell({ children: [new Paragraph(`${hours} hours`)] }),
                        new TableCell({ children: [new Paragraph(comments || 'N/A')] }),
                    ],
                });
            })
        );

        const doc = new Document({
            sections: [
                {
                    children: [
                        new Paragraph({ text: 'Project Task Details', heading: 'Heading1' }),
                        new Table({
                            rows: [
                                new TableRow({
                                    children: [
                                        new TableCell({ children: [new Paragraph('Task')] }),
                                        new TableCell({ children: [new Paragraph('Subtask')] }),
                                        new TableCell({ children: [new Paragraph('Development Hours')] }),
                                        new TableCell({ children: [new Paragraph('Comments/Notes')] }),
                                    ],
                                }),
                                ...rows,
                            ],
                        }),
                    ],
                },
            ],
        });
        Packer.toBlob(doc).then((blob) => {
            saveAs(blob, 'Project_Estimates.docx');
        });
    };

    if (!projectData || !projectData.estimates) {
        return <div>Loading project data...</div>;
    }

    return (
        <div className="results-table">
            <h3>Project Task Details</h3>
            <table>
                <thead>
                    <tr>
                        <th>Task</th>
                        <th>Subtask</th>
                        <th>Development Hours</th>
                        <th>Comments/Notes</th>
                    </tr>
                </thead>
                <tbody>
                    {estimates.map((task, taskIndex) =>
                        task.subtasks.map((subtask, subtaskIndex) => (
                            <tr key={`${taskIndex}-${subtaskIndex}`}>
                                <td>{task.task}</td>
                                <td>
                                    <input
                                        type="text"
                                        value={subtask.subtask}
                                        onChange={(e) => handleEdit(taskIndex, subtaskIndex, 'subtask', e.target.value)}
                                    />
                                </td>
                                <td>
                                    <input
                                        type="number"
                                        value={subtask.hours}
                                        onChange={(e) => handleEdit(taskIndex, subtaskIndex, 'hours', e.target.value)}
                                    />
                                </td>
                                <td>
                                    <input
                                        type="text"
                                        value={subtask.comments}
                                        onChange={(e) => handleEdit(taskIndex, subtaskIndex, 'comments', e.target.value)}
                                    />
                                </td>
                            </tr>
                        ))
                    )}
                </tbody>
            </table>
            <div className="actions">
                <button onClick={handleSave}>Save Changes</button>
                <button onClick={exportToPDF}>Export to PDF</button>
                <button onClick={exportToDOCX}>Export to DOCX</button>
            </div>
        </div>
    );
}

export default ResultsTable;
